import { gsap } from "gsap";

const App = () => {
  const headerRef = useRef();
  useLayoutEffect(() => {
    const tl = gsap.timeline();
  }, []);

  return (
    <Fragment>
      <Header ref={headerRef} />
      <Features />
      <WhyChooseUs />
    </Fragment>
  );
};

export default App;
